    window.testVCF = function(maxVCF = 1, maxDepth = 90, maxNode = 30000) {
        try {
            let sTime = new Date().getTime(),
                testNum = vcfList.length,
                succeedCount = 0,
                depth30Count = 0,
                depth50Count = 0,
                depth100Count = 0,
                depth180Count = 0,
                blackCount = 0,
                end = vcfList.length;

            function next() {
                console.log(end);
                if (end) {
                    window.openNoSleep();
                    let test = vcfList[--end];
                    findVCF(test.arr, test.color, maxVCF, maxDepth, maxNode);
                    if (vcfInfo) {
                        console.log(`color: ${vcfInfo.color}\npushMoveCount: ${vcfInfo.pushMoveCount}\npushPositionCount: ${vcfInfo.pushPositionCount}\nhasCount: ${vcfInfo.hasCount}\nnodeCount: ${vcfInfo.nodeCount}`);
                        if (vcfWinMoves.length) {
                            console.warn(movesToName(vcfWinMoves[0], 600));
                            if (vcfWinMoves[0].length < 30) depth30Count++;
                            else if (vcfWinMoves[0].length < 50) depth50Count++;
                            else if (vcfWinMoves[0].length < 100) depth100Count++;
                            else depth180Count++;
                            succeedCount++;
                        }
                    }
                    setTimeout(next, 100);
                }
                else {
                    window.closeNoSleep();
                    console.log(`: ${testNum}VCF, : ${blackCount} + : ${testNum - blackCount}\n 
                    : ${succeedCount}\n 30: ${depth30Count} + 50: ${depth50Count} + 100: ${depth100Count} + >=100: ${depth180Count}\n
                    : ${testNum - succeedCount}\n
                    : ${~~((succeedCount/testNum)*10000)/100}%\n
                    : ${~~((new Date().getTime()-sTime)/1000) + 1}\n
                    : ${~~((new Date().getTime()-sTime)/testNum)}`);
                }
            }
            next();
        }
        catch (err) {
            alert(err.message)
        }
    }

